import React from "react";
import Navbar from "../navmenu/Navbar";
import Contact from "../Contact";
import { useTheme } from "@material-ui/core/styles";
import { withStyles } from "@material-ui/core/styles";
import { Typography, Avatar, Grid, Box, Divider } from "@material-ui/core";
import backgroundImg from "../../img/animal.jpg";

const styles = (theme) => ({
  contentArea: {
    // display: "flex",
    // flexDirection: "column",
    // justifyContent: "center",
    // textAlign: "center",
    width: "70%",

    // zIndex: 1, // specifies stack order
    // border: "2px white solid",
    // borderBottom: `3px ${theme.palette.primary.light} solid`,
    margin: "auto",
  },
  header: {
    display: "flex",
    flexDirection: "column",
    minHeight: "500px",
    background: `url(${backgroundImg}) repeat center center`,
    padding: "2rem",
    margin: "0 0 1rem 0",
    justifyContent: "flex-end",
  },
});

const BlogPostTemplate = (props) => {
  const { classes } = props;
  const theme = useTheme();

  return (
    <Box className={classes.contentArea}>
      <Box className={classes.header}>
        <Typography variant="h2">"animal"</Typography>
        <Typography variant="h5">
          'the picture I found when I searched "animal" on google'
        </Typography>
      </Box>

      <Typography
        variant="body1"
        style={{
          color: theme.palette.primary.light,
          lineHeight: "1.5rem",
          padding: "0 0 .5rem 0",
          borderBottom: `1px ${theme.palette.primary.light} solid`,
          margin: "0 0 1rem 0",
        }}
      >
        date
      </Typography>

      <Typography
        variant="h2"
        style={{
          color: theme.palette.primary.light,
          lineHeight: "1.5rem",
          padding: "0 0 .5rem 0",
          borderBottom: `1px ${theme.palette.primary.light} solid`,
          margin: "0 0 1rem 0",
        }}
      >
        date
      </Typography>
    </Box>
  );
};

export default withStyles(styles)(BlogPostTemplate);
